import React from 'react';
import logo from './logo.svg';
import Button from '@material-ui/core/Button';
import './App.css';

function App() {
  return (
    <Button variant="contained" color="primary">
      Hello World
    </Button>
  );
}

export default App;

ReactDOM.render(<App />, document.querySelector('#app'));
